import * as React from 'react';
import { VFC } from 'react';
import CssBaseline from '@material-ui/core/CssBaseline';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import TwitterIcon from '@material-ui/icons/Twitter';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardMedia from '@material-ui/core/CardMedia';
import MainFeaturedPost from './MainFeaturedPost';
import Header from './Header';
import Footer from './Footer';
import topImg from './images/top.png'; 

const sections = [
  { title: 'トップ', url: '#' }
  // { title: 'Design', url: '#' },
  // { title: 'Culture', url: '#' },
  // { title: 'Business', url: '#' },
  // { title: 'Politics', url: '#' },
  // { title: 'Opinion', url: '#' },
  // { title: 'Science', url: '#' },
  // { title: 'Health', url: '#' },
  // { title: 'Style', url: '#' },
  // { title: 'Travel', url: '#' },
];

const mainFeaturedPost = {
  title: '株式会社mana',
  description:
    "このサイトは、株式会社manaのポートフォリオサイトです。",
  image: topImg,
  imageText: 'main image description',
  linkText: 'Continue reading…',
};

const social={ name: 'Twitter', icon: TwitterIcon }

const Blog: VFC = () => (
  <>
    <CssBaseline />
    <Container maxWidth="lg">
      <Header title="建築　×　IT　の境界を切り拓く" sections={sections} />
      <main>
        <MainFeaturedPost post={mainFeaturedPost} />

        <Grid container alignItems="center" justifyContent="center"  sx={{ mt: 3 }}>
          <Grid item xs={12}>
            <Typography variant="h6" gutterBottom>
              manaについて
            </Typography>
            <Divider />
          </Grid>
          <Grid item xs={3}>
            <Card>
              <CardActionArea>
                <CardMedia
                  image='/images/manaLogo.png'
                  title="manaLogo"
                />
              </CardActionArea>
            </Card>
            <img src='./images/manaLogo.png' alt="海の写真" title="空と海" />
          </Grid>
        </Grid>
      </main>
    </Container>
    <Footer
      title="会社情報"
      description="2015年設立　東京都江東区東陽"
      social={social}
    />
  </>
);

export default Blog;
